import React, { useState, useEffect } from 'react';
import axios from 'axios';

const GetChargerById = () => {
  const [id, setId] = useState(0);
  const [charger, setCharger] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.get(`http://localhost:8080/api/chargers/getcharger/${id}`); // Replace with your API endpoint URL
      setCharger(response.data);
    } catch (error) {
      // Remove console.error or replace with a user-friendly message
      // console.error(error);
      setCharger(null);
      alert('Error fetching charger details!');
    }
  };

  return (
    <div>
      <h1>Get Charger by ID</h1>
      <form onSubmit={handleSubmit}>
        <label>
          ID:
          <input type="number" value={id} onChange={(e) => setId(e.target.value)} />
        </label>
        <button className="home-hero-button1 buttonFilled">Get Charger</button>
      </form>
      {charger && ( // Display details only if charger is fetched
     
        <div>
             <style></style>
          <h2>Charger Details</h2>
          <p>ID: {charger.id}</p>
          <p>Longitude: {charger.longitude}</p>
          <p>Latitude: {charger.latitude}</p>
          <p>Rate: {charger.rate}</p>
        </div>
      )}
    </div>
  );
};

export default GetChargerById;
